import React  from 'react' ;
import { WEBSITE_NAME } from '../../../utils/websiteData';
import Helmet from 'react-helmet';
import Offer from "./Offer";
import useStyles from './Offers-jss';


const Offers = (props) => {  

    const classes = useStyles() ;

return (
        <div>
            <Helmet>
                <title> {`${WEBSITE_NAME}`}</title>
            </Helmet>
        

            <div className={`${classes.page} card-shadow`}>
                <ul className='container'>
                    <Offer title='1 - Social Aides' desc='medical services' />
                    <Offer title='2 - Medical Services' desc='other description' />
                    <Offer title='3 - Solidarity' desc='some description' />
                    <Offer title='4 - Others' desc='some description' />

                </ul>

            </div>
            
        </div>
);}

export default Offers ;
